import React from "react";
import { Route, Routes } from 'react-router-dom';
import './assets/bootstrap/css/bootstrap.min.css';
import "./assets/js/bs-init.js";
import Home from './pages/Home';

function App() {
  return (
    <Routes>
      <Route path="/" element={ <Home />}></Route>
    </Routes>
  );
}

export default App;
